import CODING_ICON from "../../images/coding.svg"
import CLIMBING_ICON from "../../images/climbing.svg"
import MANGA_ICON from "../../images/manga.svg"
import ANIME_ICON from "../../images/anime.svg"
import MUSIC_ICON from "../../images/music.svg"
import SCUBA_ICON from "../../images/scuba.svg"



export const itemWLogoArray = [
    {
        id: "coding",
        itemText: "CODING",
        itemSVG: CODING_ICON,
        mediaLink: "https://google.com"
    },
    {
        id: "climbing",
        itemText: "CLIMBING",
        itemSVG: CLIMBING_ICON
    },
    {
        id: "manga",
        itemText: "MANGA",
        itemSVG: MANGA_ICON
    },
    {
        id: "anime",
        itemText: "ANIME",
        itemSVG: ANIME_ICON
    },
    {
        id: "music",
        itemText: "MUSIC",
        itemSVG: MUSIC_ICON
    },
    {
        id: "scuba-diving",
        itemText: "SCUBA-DIVING",
        itemSVG: SCUBA_ICON
    }
]
